import React from 'react';
import { makeStyles, createStyles, Theme } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';

const useStyles = makeStyles((theme: Theme) =>
createStyles({
	paper: {
	padding: theme.spacing(2),
	textAlign: 'center',
	color: theme.palette.text.secondary,
	},
	root: {
	flexGrow: 1,
	},
}),
);

export default function FullWidthGrid() {
const classes = useStyles();

return (
	<div style={{ width: '90%', backgroundColor: 'green',
				padding: '10px' }}>
	<Grid container spacing={3}>
		<Grid item xs={12}>
		<Paper className={classes.paper}>
			GEEKSFORGEEKS ---> GRID COMPONENT DEMO
		</Paper>
		</Grid>
		<Grid item xs={6} sm={3}>
		<Paper className={classes.paper}>1/4 Size</Paper>
		</Grid>
		<Grid item xs={6} sm={3}>
		<Paper className={classes.paper}>1/4 Size</Paper>
		</Grid>
		<Grid item xs={6} sm={3}>
		<Paper className={classes.paper}>1/4 Size</Paper>
		</Grid>
		<Grid item xs={6} sm={3}>
		<Paper className={classes.paper}>1/4 Size</Paper>
		</Grid>
		<Grid item xs={12} sm={6}>
		<Paper className={classes.paper}>1/2 Size</Paper>
		</Grid>
		<Grid item xs={12} sm={6}>
		<Paper className={classes.paper}>1/2 Size</Paper>
		</Grid>
		<Grid item xs={12}>
		<Paper className={classes.paper}>Full Size</Paper>
		</Grid>
	</Grid>
	</div>
);
}
